import React, { Component } from "react";
import BlockPreview from "../components/BlockPreview";
import {Container, Row, Col} from "../components/Grid";

class BrowseStories extends Component {
    render() {
        return (
            <>
            <Container fluid>
                <Row>
                    <BlockPreview newblocklink={"/read/6"} title={"Over Hump Day"} previewtext={"Wednesday's court filing notes that since the preliminary injunction was issued, the government has worked with a steering committee regarding the status of deported parents who have children remaining in federal care. The ACLU helped lead the committee, which reached out to all the parents who had been deported."} wordcount={25} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/7"} title={"Big Trouble in Little Italy"} previewtext={"doroodoj o r gododododo rljodh jboehjo dod odoo"} wordcount={31} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/8"} title={"Lucky Joy Coffee"} previewtext={"Two things you never thought would be in the same sentence. Was it weird? No one else seemed to think so. What was going on?"} wordcount={25} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/9"} title={"It's 2:15 Somewhere"} previewtext={"There were only two weeks of class remaining. It had to be done now. There could not be any hesitation. Any mistake would have beenn brutal."} wordcount={26} contributorcount={5} />
                    <BlockPreview newblocklink={"/read/10"} title={"Torture the Parents"} previewtext={"She just stared at him for a full minute. The light turned green, but she did not notice. It was as though time had froze."} wordcount={25} contributorcount={5} />
                </Row>
            </Container>
            </>
        )
    }
}

export default BrowseStories;
